import React, { Component } from 'react';
import '../css/product.css'

// import {Thumbnail} from 'react-bootstrap';
class Product extends Component {
  render() {
    return (
        <div className="product-item">
            <img src="assets/images/product/product-1.png" alt="" className="product"/>
              <h4 className="title"><strong>{this.props.data.product_name}</strong></h4>
              <p>This is my Guitar. Don't sell<br/>{this.props.data.product_price}</p>    
        </div>
    );
  }
}

export default Product;
